import React from 'react';
import { Image } from 'antd';
import * as style from '../styles/cardStyle';

const Card = () => {
  return(
  <style.CardContainer>
    <div><Image
    width={150}
    height={150}
    src="error"
    fallback="data:image/png;base64,"
  /></div>
  <div className='title'>title</div>
  </style.CardContainer>
  )
}

export default Card;
